import React from "react";
import { Button } from "@mui/material";

function App() {
  return (
    <div style={{ padding: "2rem" }}>
      <h1>Test Vocacional</h1>
      <Button variant="contained" color="primary">
        Iniciar Test
      </Button>
    </div>
  );
}

export default App;
